def parse_value(v, builtins=sys.modules["builtins"]):
    if ":" not in v:
        return v, None

    name, fnname = v.rsplit(":", 1)
    if not hasattr(builtins, fnname):
        return v, None
    else:
        return name, getattr(builtins, fnname)

